import React from "react";
import { useAuth0 } from "@auth0/auth0-react";
import LoginButton from "../login/components/LoginButton";
import LogoutButton from "../login/components/LoginButton";

const DBoardTemplate = (props) => {
  const AuthNav = () => {
    const { isAuthenticated } = useAuth0();

    return <div>{isAuthenticated ? <LogoutButton /> : <LoginButton />}</div>;
  };

  return (
    <div>
      <div className="ui borderless massive menu">
        <div className="header item">
          <img
            className="ui image"
            src={process.env.PUBLIC_URL + "/extracy.png"}
            alt="team logo"
            style={{ width: "100px" }}
          />
        </div>

        <AuthNav />

        <div className="right item">
          <a href="https://www.google.ca/" className="vertically fitted item">
            <i className="question circle icon"></i>
          </a>
          <button className="ui button" style={{ color: "#091E42" }}>
            {" "}
            Log Out{" "}
          </button>
        </div>
      </div>

      {props.content}
    </div>
  );
};

export default DBoardTemplate;
